import './General.css';

const General = (props) => {
    return(
        <div className='general'>
            <p className='general__title'>Temas dominados</p>
            <p className='general__description'>{props.description}</p>

            <ul className='general__list'>

                {props.list.map((item) =>{
                    <li className='general__item'>{item}</li>    
                })}

                <li className='general__item'>Comandos para directorios</li>
                <li className='general__item'>Permisos chmod</li>
                <li className='general__item'>Instalaci√≥n de programas apt</li>
                <li className='general__item'>Comando 1</li>
                <li className='general__item'>Comando 2</li>
                <li className='general__item'>Comando 3</li>
                <li className='general__item'>Comando 4</li>
                <li className='general__item'>Comando 5</li>
                <li className='general__item'>Comando 6</li>
                <li className='general__item'>Comando 7</li>
            </ul>
        </div>
    );
}

export {General};
